                        var t = infoTemp.querySelector(`[${dct}="${n}"]`), anchor = document.querySelector(`[${dcta}="${n}"]`);
                        if (t && anchor) anchor.parentElement.appendChild(t);
                        else console.error('This info template "' + n + '" already use by other info function.')
